VALUES ('3596710460533', 'Tarte au saumon fromage ail et fines herbes', 'Garniture (61.1% ) lait entier (origine France), saumon (Salmo salar) 12% (poisson), oeufs, crème fraîche (lait origine France), fromage aux fines herbes 6,3% (lait et crème (lait) pasteurisés (origine UE), protéines de lait (origine UE), ail et fines herbes 0,1%, sel, épaississant agar-agar, correcteur d\'acidité : acide lactique, poivre), courgettes, eau amidon modifié de mais et/ou de riz, saumon fumé 0,9% (saumon (Salmo salar) (poisson), sel), ail, ciboulette, sel, fond de poisson (fumet poisson (cabillaud, extrait de saumon, eau, sel), maltodextrine, extrait de moule (contient mollusque), sel, fond de poulet (os, viande et graisse de poulet, eau, sel), échalote, dextrose, légumes en poudre (oignon, ail) vin blanc réduit, vinaigre d\'alcool réduit, arômes, concentré de légume (champignons, carottes, céleri, oignons), extrait de levure, sirop glucose, lactose (lait origine UE), protéines de lait (origine UE), poivre  Pâte feuilletée (38,9%) : farine (farine de blé, farine de fèves, farine blé malté), eau, margarine (huiles et graisses végétales (palme, colza), eau, sel, émulsifiant : mono - et diglycérides d\'acides gras, acidifiant : acide citrique, colorant : caroténoïdes), sel. Traces éventuelles de crustacés, moutarde, soja et fruits à coque. Pourcentages exprimés sur le total de la recette.', 'https://static.openfoodfacts.org/images/products/359/671/046/0533/front_fr.10.400.jpg', '11.3', '7.52', '20.3', '2.03', '1.13', '8.27', '0.902', '0.355', '', '0');

